import axios from "axios";
// const baseURL = "https://test-api.atom6studio.com";

const api = axios.create({
  baseURL: "https://test-api.atom6studio.com",
});

// export default api;

export default {
  handleLogin: async function (token) {
    const response = await axios
      .post("https://test-api.atom6studio.com/auth/check", {
        headers: {
          Authorization: `Bearer ${token}`,
        },
      })
      .then((res) => console.log(res));
  },
};
